import React from "react";
import "./TodoList.scss";
import TodoListItem from "./TodoListItem/TodoListItem";

const TodoList = ({ todos }) => {
  const items = todos.map((el) => {
    return (
      <li>
        <TodoListItem {...el} />
      </li>
    );
  });
  return (
    <div className="listBox">
      <div>Todo List</div>
      <ul>{items}</ul>
    </div>
  );
};

export default TodoList;
